window.bookSummaryJSON = "America's favorite bounty hunter, Stephanie Plum, is back in her eleventh adventure! <p>Trouble seems to find Stephanie Plum no matter where she goes, and once again she's struggling with her tangled love life, her chaotic family, and her God-given gift for destroying every car she drives. This time, Stephanie has decided to quit her job as a bounty hunter. She wants something safe. She wants something normal. She's tired of creeps, weirdos, and stalkers. But just when she thinks she's out, they pull her back in!</p> <p>This latest novel is packed full of Janet Evanovich's trademark wit, adventure, and sly comedy. So fasten your seatbelt and hang on...Stephanie's back in town!</p>"; 
